import React, { Component } from 'react'
import Service from '../Service/Service.js'

export default class Photo extends Component {
  constructor(props) {
    super(props)

    this.state = {
       photo:{}
    }
    this.service = new Service();
  }


  getPhoto = url => {
    this.service.photoData(url)
    .then(photo =>
      this.setState({
        ...this.state,
        photo: (this.props.match.params.id) ? photo.data : photo.data[0]
      })
    )
  };

  componentWillMount() {
    if (this.props.match.params.id) {
      this.getPhoto(`${this.props.match.params.id}`);
    } else {
      console.log('err')
    }
  }



  render() {
    console.log(this.state.photo)
    return (
      <div>
        <h1>{this.state.photo.title}</h1>
      </div>
    )
  }
}
